import React, { Component } from 'react';
import { Route } from 'react-router-dom';
import './App.css';

class App extends Component {
  render() {
    const HelloWorld = "Hello!"
    return (
      <div className="app">
        <p>{HelloWorld}</p>
      </div>
    )
  }
}

export default App;
